Este soneto es una obra característica del Romanticismo español, escrito por Juan Eugenio Hartzenbusch (1806-1880), dramaturgo, poeta y crítico español del siglo XIX. Es conocido principalmente por su obra teatral "Los amantes de Teruel", pero también escribió numerosos poemas como este soneto.
